import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';

const FacultyProfileDetails = () => {
    const [facultyData, setFacultyData] = useState(null);
    const [error, setError] = useState(null);
    const { facultyUsername } = useParams(); // Make sure this matches the route parameter

    useEffect(() => {
        fetch(`http://localhost:3001/api/faculty/${facultyUsername}`) // Ensure this endpoint matches your server route
            .then(response => {
                if (!response.ok) {
                    throw new Error(`HTTP error! Status: ${response.status}`);
                }
                return response.json();
            })
            .then(data => setFacultyData(data))
            .catch(error => {
                console.error('Fetch error:', error);
                setError(error.toString());
            });
    }, [facultyUsername]);

    if (error) {
        return <div>Error: {error}</div>;
    }

    if (!facultyData) {
        return <div>Loading...</div>;
    }

    // Render faculty data
    return (
      <div>
      <h2>{facultyData.name}</h2>
      <p>Email: {facultyData.email}</p>
      <p>Phone Number: {facultyData.phoneNumber}</p>
      <p>Department: {facultyData.department}</p>
      <p>Designation: {facultyData.designation}</p>
      <p>Qualification: {facultyData.qualification}</p>
      <p>Objectives: {facultyData.objectives}</p>
      <p>Current Portfolio: {facultyData.currentPortfolio}</p>
      <p>Diplomas: {facultyData.diplomas}</p>
      <p>Professional Background: {facultyData.professionalBackground}</p>
      <p>Areas Of Expertise: {facultyData.areasOfExpertise}</p>
      <p>Current Research Interests: {facultyData.currentResearchInterests}</p>
      <p>Professional Skills: {facultyData.professionalSkills}</p>
      <p>Research Impact: {facultyData.researchImpact}</p>
      <p>Funded Projects: {facultyData.fundedProjects}</p>
      <p>Patents: {facultyData.patents}</p>
      <p>Courses Currently Teaching: {facultyData.coursesCurrentlyTeaching}</p>
      <p>Courses Taught Previously: {facultyData.coursesTaughtPreviously}</p>
      <p>Supervised Completed Theses: {facultyData.supervisedCompletedTheses}</p>
      <p>Currently Supervising Theses: {facultyData.currentlySupervisingTheses}</p>
      <p>Proposed Research Topics: {facultyData.proposedResearchTopics}</p>
      <p>Professional Memberships: {facultyData.professionalMemberships}</p>
      <p>Awards and Distinctions: {facultyData.awardsDistinctions}</p>
      <p>Nominations: {facultyData.nominations}</p>
      <p>Professional Certificates: {facultyData.professionalCertificates}</p>
      <p>Volunteer Work: {facultyData.volunteerWork}</p>
      <p>Other Distinctions: {facultyData.otherDistinctions}</p>
      <p>Personal Interests: {facultyData.personalInterests}</p>
      <p>Office Hours: {facultyData.officeHours}</p>
      <p>Personal Website: {facultyData.personalWebsite}</p>
  </div>
);
};

export default FacultyProfileDetails;
